import React from "react";
import { audits } from "./data";

function Home() {
  return (
    <main>
      <div className="home-recent">Recent Audits</div>
      <div className="home-unresolved">Unresolved Audits</div>
      <div className="underline"></div>
      <ul>
        {audits.filter((audit) => {
          <li>
            const {(tenantid, tenantName, timeRemaining, resolved, date)} =
            audit;
          </li>;
        })}
      </ul>
    </main>
  );
}

export default Home;
